import React from 'react';
import Nav from './components/Nav'
import EmailList from './components/EmailList'
import EmailContent from './components/EmailContent';
import EmailItem from './components/EmailItem';
import './App.css';

function App() {
  return (
    <div className="App">
      <Nav/>
      <EmailList/>
      <EmailContent/>
      <EmailItem/>
    </div>
  );
}

export default App;
